  namespace: SuperOffice.CRM.Data
  summary: "\nTable &apos;CacheTables&apos;: Specifies which tables should be cached to local files (or otherwise), generally these are the lists and other low-frequency-of-change tables. Contains the ID of any tables cached in SOCache. The files are binary and called &lt;tablename>.bin.  &lt;Shift>+&lt;F5> throws all cache files. \n"
  remarks: "\nAn instance of this class represents one instance of this table in an SQL statement. In most\ncases each table appears only once in a SELECT, but in cases where you need to self-join, or\nthere are multiple occurrences for other reasons (typically additional restrictions in the joins),\nthen you will need multiple instances. <br />\nInstances of this class are created by calling <see cref=\"!:TablesInfo.GetCacheTablesInfo()\"></see>.\n"
  syntax:
    content: >-
      [DatabaseTable("CacheTables")]

      public class CacheTablesTableInfo : TableInfo, ICloneable
    content.vb: >-
      <DatabaseTable("CacheTables")>

      Public Class CacheTablesTableInfo
          Inherits TableInfo
          Implements ICloneable
